import React from "react";

function Message({ message, onConfirm, onCancel }) {
  return (
    <div className="custom-confirm-dialog">
      <p>{message}</p>
      <button onClick={onConfirm}>Yes</button>
      <button onClick={onCancel}>No</button>
    </div>
  );
}

export default Message;
